tables.table_schema:
CREATE TABLE SocialMediaEngagement (
  social_media_id INT PRIMARY KEY,
  engagement_count INT,
  influencer_id INT,
  event_date DATE
);

CREATE TABLE FashionShowImpact (
  fashion_show_id INT PRIMARY KEY,
  audience_reach INT,
  collaboration_id INT,
  event_date DATE
);

CREATE TABLE FashionShows (
   show_id INT PRIMARY KEY,
   show_name VARCHAR(255),
   show_date DATE,
   location VARCHAR(255)
);

CREATE TABLE Influencers (
   influencer_id INT PRIMARY KEY,
   influencer_name VARCHAR(255),
   followers_count INT,
   platform VARCHAR(50)
);

CREATE TABLE SocialMediaUsers (
    user_id INT PRIMARY KEY,
    username VARCHAR(50),
    followers_count INT,
    engagement_score FLOAT
);

CREATE TABLE Influencers (
    influencer_id INT PRIMARY KEY,
    influencer_name VARCHAR(50),
    followers_count INT,
    engagement_rate FLOAT
);

CREATE TABLE Collaborations (
    collab_id INT PRIMARY KEY,
    influencer_id INT,
    show_id INT,
    collaboration_date DATE
);
